import "../Card/Card.css"
import anillo1 from "../../Assets/anillo-1.png";


const ItemCount = () => {
    return (
        <div className="container__cart">
            <div className="cart">
                <a href="index.html"><img className="cart__image" src={anillo1} alt="Anillo Cómo Decírtelo Joyas"/></a>
                <h3>ANILLO ELEFANTE</h3>
                <h4>$3950</h4>
            </div>
        </div>

    )
}

export default ItemCount
